export const doSomething = (chicken) => (dispatch) => {
	dispatch({
		type: "DO_SOMETHING",
		payload: { ...chicken },
	})
}

export function peelThePotato(chicken) {
	console.log('peeling the goddamn potato');
	return {
		type: "PEEL_THE_POTATO",
		payload: Object.assign({}, chicken),
	}
}

export function requestToDatabase(chicken) {
	return {
		type: "REQ_TO_DATABASE",
		payload: { ...chicken },
	}
}
